pragma solidity ^0.5.0;

contract PetRegistration {
    struct Pet {
        string name;
        string breed;
        uint256 age;
        string photoUrl;
    }

    mapping (uint256 => Pet) public pets;
    uint256 public petCount;

    function registerPet(string memory _name, string memory _breed, uint256 _age, string memory _photoUrl) public payable {
        require(msg.value >= 0.01 ether, "Registration fee is 0.01 ether");

        pets[petCount] = Pet({
            name: _name,
            breed: _breed,
            age: _age,
            photoUrl: _photoUrl
        });

        petCount++;
    }
}
